  useEffect(() => {
      console.log(setting);
  });


  return (
    <div>
      Home asdfg
      <h2>
        Theme Color: {setting.theme_color}
      </h2>
      <button onClick={()=>changeSetting('theme_color','dark')}>Change</button>

      <br />
      <br />
    </div>
  )
}

export default Home;
